import React from 'react';

import LinkItem from '../components/LinkItem/LinkItem'

import styles from './DefaultPage.module.css'

//{ match, handleClick, }
export default ( {match} ) => {
  const items = JSON.parse(localStorage.getItem('doctors')[match.params.departmentId]);
  console.log('items doctors', items)
  console.log(localStorage)
	if (items.length !== 0) {
		return (		
			<div className={styles.page}>
				<ul className={styles.list}>
					{items.map(item => <LinkItem 
                              // handleClick={handleClick}
                              key={item['id']}
                              index={item['id']}
                              text={item['lastName'] + ' ' + item['firstName'] + ' ' + item['secondName']} />)}
				</ul>
			</div>
		);
	}

	return <h2>Сначала авторизуйтесь</h2>;
};
